import { render } from "react-dom";

class Symptoms extends React.Component {


    constructor(props) {
        super(props);

        this.state = {
            symptomList : [
                "Sore Throat.",
                "Fatigue.",
                "Hungry for pizza.",
                "Tired of being home.",
                "Body aches.",
                "Empty Wallet.",
                "Sleepy",
                "TBD symptom",
                "Face mask tan",
                "Long hair or mullet",
                "Feeling hot outside"
            ],
            index: 0
        }
       
    }
  
    componentDidMount() {

     //   this.banner();

     console.log("console did mount")

     //setTimeout(console.log("its time"),7000);
     this.myTimer();

    }

    myTimer = () => {
        setTimeout(
            function() {
                this.setState({index: this.state.index + 1});
                console.log("after increase")
                this.myTimer();
            }.bind(this), 5000)
    }

    // banner = () => {
    //    // console.log("checking index: " = this.state.index)
    //     if ( this.state.index > 10 ) {
    //         console.log("index is > 10")
    //         this.setState({index: 0})
    //     } 

    //     setTimeout(this.increment(this.state.index),3000)

    // }

    // increment = (value) => {
    //     console.log("value : " + value)
    //     this.setState({index: value + 1})
    // }



render() {


    return (
        <div>
            <p>New Side Effects Include..</p>

            <div>{this.state.symptomList[this.state.index]}</div>

        </div>
    )
        



}


}

export default Symptoms;
